import React, { useState, useEffect } from 'react';
import { Link, useParams, useNavigate, useLocation } from 'react-router-dom';

const CooperationNavbar = () => {
    const { id } = useParams(); // ID на кооперацията от URL-то
    const navigate = useNavigate();
    const location = useLocation();

    // Съхраняваме информацията за кооперацията в стейта
    const [cooperation, setCooperation] = useState({
        id: id || '', // Вземи id от URL или празен стринг
        name: '',     // Име на кооперацията
        rsp: '',      // Допълнителни данни
    });

    // Извличане на информация от предишно състояние (ако има)
    useEffect(() => {
        if (location.state && location.state.building) {
            setCooperation({
                id: location.state.building.id || '',
                name: location.state.building.title || 'Unknown Cooperation',
                rsp: location.state.building.rsp || ''
            });
        }
    }, [location.state]);

    return (
        <nav className="navbar navbar-expand navbar-blue bg-blue">
            <Link to="/" className="navbar-brand">
                {cooperation.name} {/* Показва името на кооперацията */}
            </Link>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to={`/quick-create/${cooperation.id}`} className="nav-link">
                        Quick Create
                    </Link>
                </li>
            </div>
            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to={`/cooperation/${cooperation.id}/update`} className="nav-link">
                        Update Cooperation
                    </Link>
                </li>
            </div>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to={`/cooperation/${cooperation.id}/floors`} className="nav-link">
                        Floors
                    </Link>
                </li>
            </div>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to={`/cooperation/${cooperation.id}/apartments`} className="nav-link">
                        Apartments
                    </Link>
                </li>
            </div>

            <div className="navbar-nav ml-auto">
                <li className="nav-item">
                    <Link to={`/cooperation/${cooperation.id}/garages`} className="nav-link">
                        Garages
                    </Link>
                </li>
            </div>
        </nav>
    );
};

export default CooperationNavbar;
